We recommend that you keep parsing classes in seperate files. They should also all be subclasses of Expression. In this example, a good parsing name could be Bee, therefore, we could create the following in bee.ts: export default class Bee extends Expression { // Value is going to contain the integer value. value: string constructor(value: string) { this.value = value; } Every Expression should override the static parse and the toJavaScript methods. Let's tackle the parse first. The function takes in a tokenized code and outputs this object: public static parse(ts: TokenStream): Bee { Now, we need to make the logic for the parsing. Using the analysis from before, we expect identifiers until the End of stream therefore: let accumulator = ""; while(!(ts.peek`${End}`)) { We can then try to parse the identifiers: let [bee] = ts.parse`${Ident}`; We can use regex to determine if the identifier value is bee... else throw an error: if(!/^[Bb]e*$/.test(bee.value)) throw ts.error("Passed text is not bee."); We expect also all bee... to have less than 10 e (due to integer definition): if(bee.value.length > 10) throw ts.error("Bee should be smaller than 11 letters."); Finally, we can add the number to the string number accumulator: accumulator += bee.value.length - 1;
} And return the Bee object: return new Bee(accumulator);
} We can then tackle the toJavaScript which in this case will simply return the value (you can use quote to remove the number of toJavaScript to use): public toJavaScript(): string { return quote`${this.value}`;
}
}

